import React from 'react';
import Productos from './Productos';
import Footer from './Footer';
import Header from './Header';

class Aplicacion extends React.Component{
    render(){
        return(
            <div>
                <Header />
                <Productos />
                <Footer />
            </div>
        );
    }
}

export default Aplicacion;
